webpackJsonp([0xc12015d7616d],{7735:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/306577150/" title="Photo Sharing"><img src="https://static.flickr.com/99/306577150_a3743243fb.jpg" width="500" height="375" alt="IMG 1797" /></a></p>\n<p>We\'ve got a heat wave for the end of November. Today was 13°C (mid 50s°F), sunny with a mild breeze. The grass is still green, and the air even smells fresh. It could be springtime, if it weren\'t for all the leaves on the ground to rake. We <a href="http://www.flickr.com/photos/papascott/sets/72157594392567520/">took a walk</a> this afternoon to appreciate the spring air... Christopher even took his bike (until the mud came). <a href="http://www.flickr.com/photos/papascott/sets/72157594392567520/show/">Slideshow</a></p>',fields:{title:"Springtime in the Fall",date:"26 Nov 2006",url:"https://papascott.de/2006-11-26-springtime-in-the-fall/"}}},pathContext:{slug:"/2006-11-26-springtime-in-the-fall/",prev:{fields:{title:"The Pig Revisited",date:"23 Nov 2006",slug:"/2006-11-23-the-pig-revisited/"}},next:{fields:{title:"Bild Hamburg Page 6",date:"27 Nov 2006",slug:"/2006-11-27-bild-hamburg-page-6/"}}}}}});
